class Solution:
    def corpFlightBookings1(self, bookings, n: int):
        res = [0] * (n + 1)
        for i, j, k in bookings:
            for t in range(i, j+1):
                res[t] += k
        return res[1:]

    def corpFlightBookings(self, bookings, n: int):
        res = [0] * (n+1)

        order = 1
        for i,j ,k in bookings:
            res[i] += k
            res[j] -= k
        for t in range(2, n+1):
            res[t]  = res[t-1] + res[t]
        return res

